// Copyright 2020 Prescryptive Health, Inc.

export enum VerticalMobile {
  Double = '7.8816vh',
  Bigger = '5.9113vh',
  Big = '3.9408vh',
  Medium = '2.9556vh',
  Regular = '1.9704vh',
  Small = '0.9852vh',
}

export enum HorizontalMobile {
  Double = '25.6vw',
  Bigger = '12.8vw',
  Big = '8.5333vw',
  Medium = '6.4vw',
  Regular = '4.2666vw',
  Small = '2.1333vw',
}

export enum BorderRadius {
  input = 4,
  container = 8,
}
